(1, '1st CDL Training Center of NOVA', 'http://www.cdlnow.com', 'Virginia CDL Training, CDL training Virginia and Washington DC Metro', 'Our business is based on principles of Honesty, Reliability and Quality.  Located in Alexandria, Virginia We understand that every student is different. That''s why we offer \r\nprograms specific to your needs. We offer one on one instruction in small groups with no waiting to get started.  We service Alexandria, Arlington, Fairfax County and surrounding Northern Virginia\r\n\r\n\r\nOur schedules are designed to be flexible for the students, who work and study at the same time. We want you not only to pass the exam but to be successful, safe, \r\nand confident behind the wheel.  \r\n\r\nRealizing that learning how to drive a big truck can be a stressful experience, First CDL Training Center Of Nova takes precautions to make the learning experience as relaxed and hassle free as possible. Our instructors are friendly and our equipment is top of the line.   First CDL Training Center Of Nova offer extra room to manoeuvre, this is the best place to learn how to drive a big truck without worrying about hazards faced & traffic situations.\r\n\r\n', 20, 'Y', 'Commercial Driving, CDL, Trucking, Hauling, 18 Wheeler', 0, '2014-04-05 05:23:03', '2014-04-05 06:13:21'),
(2, 'A-1 CDL School', 'http://www.a1cdlschool.com', '', '', 20, 'Y', 'Commercial Driving', 0, '2014-04-05 05:23:03', '0000-00-00 00:00:00'),
(3, 'AAA CDL School', 'http://www.aaacdlschool.com', '', '', 20, 'Y', 'Commercial Driving', 0, '2014-04-05 05:23:03', '0000-00-00 00:00:00'),
(4, 'Ace Tech Institute', 'http://temp.contractva.com/', 'A Stepping Stone to Business Success!', '<p>Bringing a decade of experience in quality classroom instruction and over 14 years'' teaching experience, Ace Tech Institute (ATI) is committed to excellence in education Contract VA main page photo for your contractor/MEP license. Over 4,800 ATI clients have become licensed contractors in Virginia and Maryland. We have successfully prepared students for the Contracting profession through our complete, personable in-class programs. By taking our courses, our students have gained leadership in various areas of specialization(e.g., electricians, plumbers, HVAC technicians, etc.). We provide high-quality, comprehensive and accessible training opportunities that respond to ever-changing construction industry demands. Our goal is to enable you to reach your professional potential to better face competition within the marketplace.<br></p>', 72, 'Y', 'Trade, Contractor, License,Business', 0, '2014-04-05 05:23:03', '2014-04-10 03:36:51'),
(5, 'Action in Community Through Service (ACTS)', 'http://actspwc.org', '', '', 40, 'Y', 'Healthcare', 0, '2014-04-05 05:23:04', '0000-00-00 00:00:00'),
(6, 'Aerostar Training Services', 'http://www.aerostartyperatings.com/', 'AeroStar Training Services is the very best choice for adding power and lift to your aviation career.', '<p>  AeroStar is an FAA Certified 142 Training Center serving the needs \r\nof individuals seeking pilot certification training and aircraft type \r\nratings on the Airbus A320, A330*, A340*, Boeing 737, and BBJ.\r\n We offer FAA approved initial type ratings, recurrent, upgrade and \r\ndifferences training. We also offer initial and recurrent flight \r\nattendant training.</p>\r\n<p>  We offer the best schedule flexibility, the highest quality \r\ntraining and the most competitive pricing. Before you choose your next \r\ntraining provider you owe it to yourself to shop around and compare. \r\nHere are some of the key benefits of training with AeroStar:\r\n</p>\r\n<h3>The AeroStar Difference<br> </h3>\r\n<ul class="list-1"><li>Clear,       fun, <strong>courseware</strong> gives you the       \r\nflexibility to learn at home and arrive oriented, comfortable, and      \r\n prepared to make the most of your time with us. \r\n  </li><li>World-class, computer-based or classroom <strong>Ground School Training</strong> that gives you the solid background knowledge you need to feel confident in the cockpit. \r\n  </li><li>The <strong>most advanced simulators</strong> that provide realistic flight experiences before you ever leave the ground. \r\n  </li><li><strong>Experienced airline faculty</strong> with a passion for \r\nteaching  they care about your success and spend the time needed to be \r\nsure you       understand and have a great time. </li></ul>', 11, 'Y', 'Aviation, Airbus, A320, A330, A340, Boeing 737, BBJ, FAA', 0, '2014-04-05 05:23:04', '2014-04-10 03:40:21'),
