(29, 'Daja Institute', 'http://www.dajainstitute.com', 'With the aging American population there is a large nurse shortage.', '<p>Daja Institute<br><br>With the state of the economy, you want to quickly train in a career that can land you a good job at anytime. Following the state of the economy and shortage of nurses, DAJA INSTITUTE has designed affordable specialized training programs to prepare you for a promising career in healthcare.<br><br>WHY STUDY NURSING?<br>With the ageing American population there is a large nurse shortage - growing daily. The demand for nursing professionals will create 1 million+ new jobs & is already lifting nurse salaries. We have researched and compiled a list of top careers and career trends to help you consider where your services will be most in need and what fields you may want to study.<br>Further Your Nursing Career Today! <br> <br></p>', 54, 'Y', 'Healthcare, Nursing', 0, '2014-04-05 05:23:11', '2014-04-05 05:32:54'),
