(103, 'Virginia School of Pet Grooming', 'http://www.virginiaschoolofpetgrooming.com', 'The Virginia School of Pet Grooming has been teaching professional pet grooming for the past 20 years.', '<p>\r\n    \r\n    </p><h1 style="color: #564343; font-size: 18px; text-align: center; font-weight: normal;">Manassas Park, VA Pet Grooming Training Courses</h1>\r\n    <p>The Virginia School of Pet Grooming in Manassas Park, VA bas been\r\n teaching professional pet grooming for the past 20 years. Learn more \r\nabout the courses we offer by reviewing the course descriptions below.<font color="#000000" face="Times New Roman, Times, serif" size="3"><br>\r\n    </font></p>\r\n    <p><font color="#000000" face="Times New Roman, Times, serif" size="3"><b>History \r\n      of the Dog</b></font></p>\r\n  <p><font color="#000000" face="Times New Roman, Times, serif" size="3">A study \r\n    of the evolution of the canine. Each AKC breed will be studied according to \r\n    breed group and students will gain the ability to identify each breed individually \r\n    as well as becoming familiar with the backgrounds and standards of each.<br>\r\n    </font></p>\r\n  <p><font color="#000000" face="Times New Roman, Times, serif" size="3"><b>Animal \r\n    Psychology and Behavior</b></font></p>\r\n  <p><font color="#000000" face="Times New Roman, Times, serif" size="3">Discussion \r\n    of the canine as a pack animal and relating these instincts to canine behavior \r\n    in pets. An understanding of this behavior will aid the student in the handling \r\n    of dogs during the grooming process. We will also cover the application of \r\n    humane restraining techniques for a variety of situations.<br>\r\n    </font></p>\r\n  <p><font color="#000000" face="Times New Roman, Times, serif" size="3"><b>First \r\n    Aid and CPR for Dog, Cat, and Man (Video) </b></font></p>\r\n  <p><font color="#000000" face="Times New Roman, Times, serif" size="3">Administration \r\n    of first aid for a dog or cat in life threatening situations, prevention of \r\n    further complications/injury and sustaining life until professional help can \r\n    be obtained. Human first aid will include how to administer to a dog or cat \r\n    bite until professional help can be obtained (Feline section will be omitted \r\n    for those courses not including training with cats).<br>\r\n    </font></p>\r\n  <p><font color="#000000" face="Times New Roman, Times, serif" size="3"><b>Selection \r\n    of Equipment: Safety, Care, and Sanitation</b></font></p>\r\n  <p><font color="#000000" face="Times New Roman, Times, serif" size="3">The various \r\n    types of grooming equipment available and the importance of proper selection \r\n    is discussed. Instruction on the correct application and handling of basic \r\n    equipment will be given to the student. Safety precautions followed in the \r\n    grooming salon and the importance of properly disinfecting equipment to prevent \r\n    the transmission of parasites and disease will be covered and applied on a \r\n    daily basis. Students will be required to clean and disinfect their own equipment \r\n    and work area during the practical portion of this course.<br>\r\n    </font></p>\r\n  <p><font color="#000000" face="Times New Roman, Times, serif" size="3"><b>Diseases/Parasites: \r\n    Identification and Sanitation</b></font></p>\r\n  <p><font color="#000000" face="Times New Roman, Times, serif" size="3">An overview \r\n    of contagious disease in the canine and feline. Students are instructed on \r\n    how to communicate to the client in regard to suspected illness and the importance \r\n    of recommending veterinary attention when indicated. Students will be taught \r\n    to recognize the parasites which commonly host on the internal and external \r\n    anatomy of the dog and cat. Symptoms, life cycles, yard control and prevention \r\n    are stressed.</font>      <font color="#FF0000" face="Times New Roman" size="3"><br>\r\n    </font></p>', 150, 'Y', 'Veterinary Tech, Grooming, Pet, Dog, Cat', 0, '2014-04-05 05:23:46', '2014-04-05 06:19:36'),
